  "text" : "土木工学の分野（主に鋼構造とかコンクリート材料）には、まぁ収縮する部材はないにしろ、温度変化に対する膨張率が違う材料を組み合わせて膨張率をなるべく一定にする設計とかありましてね（主に鋼構造とかコンクリート材料とかの分野で）。 [n]",
