  "text" : "[問] 1℃の気温上昇で2%伸長する材料Aと1%の収縮する材料Bがあるとき、AとBを組み合わせて全体としての伸長も収縮もしないはり部材を設計しなさい。\n[答] Aを1m、Bを2mにしてくっつける。 [n]",
