  "text" : "シャーロックホームズの有名な言葉に「地球が太陽の周りを回っていようと、太陽が地球の周りを回っていようと、僕の仕事にはなんら影響がないのだよ」というのがあるけど、まさにその通りだと思うし、「必要でないものは忘れておかないと、必要なものが思い出せなくなる」とも述べてます。 [n]",
