  "text" : "世の中で起こってるそのほとんどは自分の人生に直接影響を及ぼすものではなくて、それを知ってようが知ってまいが何も変わらないことなわけで。そういう意味で「ニュースは知ってなきゃ」ってのは、無駄なことを覚えてるだけに過ぎない。 [n]",
