  "text" : "「水路の水の流れ（乱流）において重要なのは地面から水深の20%程度の内層と呼ばれる部分で、よく検討対象となる水面付近を含む残りの80%である外層は、内層によって動かされてるにすぎない。これはちょうど、自動車の乗車部分は、タイヤとエンジンに動かされてるにすぎないのと似ている。」",
