  "text" : "前から言われてることだけど、太陽光とか風力とかを「再生可能エネルギー」っていうのはおかしいんですよ。なんども生成しなおしてるわけじゃないんで。正しくは「（エネルギー取得が）持続可能エネルギー」 [n]",
