  "geo" : {
  },
  "id_str" : "69664436935331840",
  "text" : "日本に住んでて、というか、世界のどこでも「安全な場所」は存在しないし、危険度だって調べればどこだって似たようなもんです。大切なのは、「そこでどんな災害が起きうるか」を把握して「それが起きた場合にどうするか」を調べて備えておくことです。 [n]",
