  "id_str" : "64565708570365952",
  "text" : "「甘くて苦いもの」を作っているのだからこそ、「甘いもの」が欲しい人にも、「苦いもの」が欲しい人にも、「甘くて苦いもの」が欲しい人にも提供できるのです。 #jawp",
