  "id_str" : "64565610876649472",
  "text" : "「CC-BY-SAかつGFDL」を作っているのだからこそ、「CC-BY-SA」が欲しい人にも、「GFDL」が欲しい人にも、「CC-BY-SAかつGFDL」が欲しい人にも提供できるのです。 #jawp",
