  "id_str" : "64558939542536192",
  "text" : "よく誤解されがちなのだけど、 #jawp 含めてウィキメディアがGFDLではなくCC-BY-SAも採用しようとしたのは、（外部での）再利用がGFDLではめんどいからであって、だから「完全にCC-BY-SAのみじゃなく、GFDLもつけといた方が便利だよね」って意味でデュアルです。",
  "id" : 64558939542536192,
