  "text" : "まぁそれはともかく、いっそのこと「 #jawp はこれからはCC-BY-SAだけにします！！」って言う議論とか提案をするのは十分にありだと思ってはいる。技術的にもライセンス的にもそれは可能なので（グローバルの説得が若干めんどいけど。",
